  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Des Lacs National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1955.
  The report begins by summarizing the weather conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, raptors, fish, and disease- is
  also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, and collections and receipts. Resource management is outlined;
  topics include grazing and haying. A progress report on field investigations and
  applied research is also provided. The public relations section of the report describes
  recreational uses, Refuge visitors, and Refuge participation. Items of interest,
  N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License Not
